import React from "react";
import { css } from "@emotion/core";
// First way to import
import { ClipLoader } from "react-spinners";
import { FadeLoader	 } from "react-spinners";
import { RingLoader} from "react-spinners";
import {Link} from "react-router-dom";
import { Form, Icon, Input, Button, Checkbox } from "antd";

import axios from "axios";
const FormItem = Form.Item;

// Can be a string as well. Need to ensure each key-value pair ends with ;


class AwesomeComponent extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
    loading: false
    };
  }

  onClick = () => {
  /*
    Begin by setting loading = true, and use the callback function
    of setState() to make the ajax request. Set loading = false after
    the request completes.
  */
  this.setState({ loading: true }, () => {})

}

  render() {
  const override = css`
  display: block;
  margin: 0 auto;
  border-color: red;
  loading: true;
  color: "red";
  css: "";
`;


localStorage.clear();
    const { getFieldDecorator } = this.props.form;
    return (
      <div className="login-form-container">
        <div className="header-login">
          <div className="login-logo">
            <img src="/assets/images/logo-white.png" alt="SQ"/>
          </div>
        </div>
      <div className="login-cell cell-login-form">
            <div className="bg-image-mobile" style={{backgroundImage: 'url(/assets/images/login-bg.jpg)'}}></div>
            <div className="login-cell-block">
              <div className="login-logo text-center">
                <img src="/assets/images/logo-white.png" alt="SQ"/>
              </div>
              <div className="logo-with-form login-cell-content">
                <h4 className="mb-3">Login with SQ</h4>
                <Form onSubmit={this.handleSubmit} className="login-form">
                  <FormItem>
                    {getFieldDecorator("userName", {
                      rules: [
                        {
                          required: true,
                          message: "Please input your Username!"
                        }
                      ]
                    })(
                      <Input refs="u_name" size="large"  value={this.state.username}
                      prefix={ <Icon type="user" style={{ color: "rgba(0,0,0,.25)" }} />  }
                        placeholder="Username"
                      />
                    )}
                  </FormItem>
                  <FormItem>
                    {getFieldDecorator("password", {
                      rules: [
                        {
                          required: true,
                          message: "Please input your Password!"
                        }
                      ]
                    })(
                      <Input refs="u_pass"
                        size="large"
                        value={this.state.password}
                        prefix={
                          <Icon
                            type="lock"
                            style={{ color: "rgba(0,0,0,.25)" }}
                          />
                        }
                        type="password"
                        placeholder="Password"
                      />
                    )}
                  </FormItem>
                  <FormItem>
                    <ul className="login-meta">
                      <li>
                        <Link to='/forgot-password'>
                          Forgot password ?
                        </Link>
                      </li>
                      <li>
                        <Checkbox>Remember Me</Checkbox>
                      </li>
                    </ul>
                  </FormItem>
                  <FormItem>
                    <Button
                      type="primary"
                      htmlType="submit"
                      size="large"
                      className="login-form-button"
                      style={{ width: "100%" }}
                    >
                      Log in
                    </Button>
                  </FormItem>
                  <FormItem>
                    <p style={{ color: "red" }}>{this.state.msg}</p>
                  </FormItem>
                </Form>

                <div className="not-user">
                  New User? <Link to=''>Signup</Link>
                </div>
              </div>
            </div>
          </div>
    </div>
    );
  }
}
 export default AwesomeComponent;
